resources.string:
Jei įvedate ne pagalbos numerį:
 • jūsų įrenginys turi būti atrakintas, kad būtų galima iškviesti pagalbą kritiniu atveju;
 • į jūsų skambutį gali būti neatsiliepta.

Bus iš naujo nustatytos visos nurodytų elementų nuostatos:


išjungtos programos;

išjungti programų pranešimai;

numatytosios veiksmų programos;

programų foninių duomenų apribojimai;

visi leidimų apribojimai;

akumuliatoriaus energijos vartojimo nustatymai.

Neprarasite jokių programų duomenų.
